import React from 'react';
import Card from 'react-bootstrap/Card';


export default class Profile extends React.Component{
	constructor(props){
	super(props);
	this.state = {
		firstName: 'Helllo',

		lastName: 'hello',
		email: '', 
		message: 'Hello all',
		recommendation: 'I like Barcelona, Rome, and Berlin!',

		}
	}

	render() {
		return(
			<div>
			<Card className="profile-card" style={{ width: '18rem' }}>
			  <Card.Body>
			    <Card.Title>{this.state.firstName}'s Profile</Card.Title>
			    <Card.Subtitle className="mb-2 text-muted">Click Here to Chat</Card.Subtitle>
			    <Card.Text>
			      {this.state.recommendation}
			    </Card.Text>
			     <Card.Text>
			      {this.state.message}
			    </Card.Text>
			  </Card.Body>
			</Card>
			</div>
		)
	}
}
